import React, {useState, useEffect} from "react";
import axios from 'axios';
import Swal from "sweetalert2";


import { Button, Card, CardBody, CardTitle, CardSubtitle, CardText } from 'reactstrap';


function Upimg(){

    const [data, setData] = useState([])

    useEffect(() =>{
        axios.get('http://localhost:3000/api/product/view')
        .then(res =>{
            console.log(res.data)
            setData(res.data)
        })
        .catch(err =>{
            console.log(err)
        })
    }, [])


    const postDelete = (id,e) =>{
        e.preventDefault();
        axios.delete(`http://localhost:3000/api/img/eliminar?id=${id}`)
        .then(res => console.log(res))
        .catch(err => console.log(err))
        Swal.fire({
            title: 'Eliminando...',
            text: 'Usuario de Id: ' + id + ' Eliminado',
            icon: 'warning',
            confirmButtonText: 'Ok'
        })
    }

    const arr = data.map((data, index)=>{
        return(
            <tr className="fila_impar">
                <td>{data.id}</td>
                <td>{data.username}</td>
                <td>{data.email}</td>
                <td>{data.password}</td>
                <td>{data.phone_number}</td>
                <td><button onClick={(e) => postDelete(data.id, e)} type="button" class="btn btn-outline-danger btn-sm">Delete</button></td>
            </tr>

        );
    })


    return (
        <React.Fragment>

            <table border="1">
                <tr>
                    <th>ID</th>
                    <th>Nombre</th>
                    <th>Correos</th>
                    <th>Password</th>
                    <th>Numero cel</th>
                    <th>Eliminar user</th>

                </tr>
                {arr}
            </table>
            <table>
                <th>ID</th>
                <th className="btn btn-outline-primary btn-sm">Update</th>
                <th className="btn btn-outline-primary btn-sm">Update</th>
                <th className="btn btn-outline-primary btn-sm">Update</th>
                <th className="btn btn-outline-primary btn-sm">Update</th>
                <th>Eliminar   </th>
            </table>
            <div className="mb-3">

                <a className="btn btn-outline-primary">Back</a>
                <a className="btn btn-outline-success">To Update</a>

            </div >

        </React.Fragment>
    );
}

export default Upimg;
